  false,\n\t\"url\": null,\n\t\"notes\": \"The Mountain Longleaf National Wildlife
  Refuge Habitat Management Plan provides a long-term vision and specific guidance
  on managing habitats for the resources of concern at Mountain Longleaf National
  Wildlife Refuge, to facilitate continuity in management programs. Refuge background,
  resources of concern, and habitat management goals and objectives are discussed.
  Management strategies and prescriptions then identify how and the specific means
  by which management and monitoring strategies will be implemented. Appendices follow.\",\n\t\"license_title\":
